import React from "react";
import { Grid, makeStyles } from "@material-ui/core";

import GridComponent from "../common/Grid/Grid";
import Post from "./Post";

const useStyles = makeStyles({
  gridContainer: {
    alignContent: "stretch",
    alignItems: "stretch",
  },
  gridItems: {
    alignSelf: "auto",
  },
});

export default function Posts({ items, like, onLike, onDisLike }) {
  const classes = useStyles();
  return (
    <Grid container spacing={2} className={classes.gridContainer}>
      {items.map((i) => (
        <Grid item xs={3} key={i.id} className={classes.gridItems}>
          <Post item={i} onLike={onLike} onDisLike={onDisLike} like={like} />
        </Grid>
      ))}
    </Grid>
  );
}
